import './expenses.css'
import ExpenseItem from './ExpenseItem'

function Expenses(props) {
  return (
    <div>
      <ExpenseItem 
      title={props.items.title}
      amount={props.items.amount}
      date={props.items.date}
       />

    </div>
  )
}

export default Expenses
